  false,\n\t\"url\": null,\n\t\"notes\": \"This water-resources evaluation of Ruby
  Valley was divided into two 3-year phases. Phase 1 was designed to quantify annual
  evapotranspiration (ET) from the Ruby Lake National Wildlife Refuge (Ruby Lake NWR)
  for the 2000 water year (Berger and others, 2001). The 2000 water year is from October
  1, 1999, to September 30, 2000. Presented in this report are the results of phase
  2 of the overall investigation. This report presents information on the hydrogeologic
  framework and water resources of Ruby Valley, including an updated water budget
  and estimates of ground-water recharge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
